import React from "react";
import { Circle, Square, Triangle } from "lucide-react";
import { useNavigate } from "react-router-dom";
import "./StartGameButton.css"; // Import the CSS file

const StartGameButton = () => {
  const navigate = useNavigate();

  const handleStartGame = () => {
    navigate("/game"); // Redirect to the game page
  };

  return (
    <div className="start-game-container">
      <div className="start-game-content">
        {/* Animated shapes */}
        <div className="animated-shapes">
          <Circle className="shape-circle" size={48} />
          <Square className="shape-square" size={48} />
          <Triangle className="shape-triangle" size={48} />
        </div>

        <h1 className="start-game-heading">Welcome to Shape Counting Game!</h1>

        <p className="start-game-description">
          Ready to have fun with shapes? Let's start counting! ðŸŽ®
        </p>

        <button
          onClick={handleStartGame}
          className="start-game-button"
        >
          Play Game! ðŸŽ¯
        </button>
      </div>
    </div>
  );
};

export default StartGameButton;
